import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import AppBar from '@material-ui/core/AppBar';
import Typography from '@material-ui/core/Typography';
import { IconButton, Paper, Toolbar } from '@material-ui/core';
import ListIcon from '@material-ui/icons/List';
import SettingsIcon from '@material-ui/icons/Settings';

const useStyles = makeStyles({
  card: {
    margin: "auto",
    width: 600,
    height: 600,
    marginTop: 200,
    borderRadius: 10
  },
  appbar: {
    position: 'static',
  },
  toolbar: {
    height: 80,
  },
  title: {
    marginLeft: "auto",
    marginRight: "auto",
  },
  cardContent : {
    padding:0
  },
  content: {
    position:"relative",
    marginLeft: 40,
    marginRight: 40,
    marginTop: 40,
    height: 340,
  },
  index: {
    paddingRight:20,
    paddingTop: 10,
    textAlign:"right",
  },
  sentence: {
    height:160,
    textAlign:"center",
  }

});

export default function SimpleCard() {
  const classes = useStyles();

  return (
    <Card className={classes.card}>
      <AppBar className={classes.appbar} elevation={1} >
        <Toolbar className={classes.toolbar}>
          <IconButton color="inherit" aria-label="List">
            <ListIcon fontSize="large" />
          </IconButton>
          <Typography variant="h4" className={classes.title}>
            Voice Collector
          </Typography>
          <IconButton color="inherit" aria-label="Setting">
            <SettingsIcon fontSize="large" />
          </IconButton>
        </Toolbar>
      </AppBar>
      <CardContent className={classes.cardContent}>
        <Paper className={classes.content}>
          <div className={classes.index}>
            <Typography variant="h6">015 / 300</Typography>
          </div>
          <Paper className={classes.sentence}>
            Test
          </Paper>
        </Paper>
      </CardContent>
    </Card>
  );
}
